import React from 'react';
import './propertyDetails.styles.css';

const PropertyDetails = ({ address, photo, history }) => {
  return (
    <div className="property-details">
      <img
        className="property-image"
        src={`http://localhost:3000/images/${photo}`}
      />
      <div className="property-image-footer">
        <span>{address}</span>
      </div>
    </div>
  );
};

export default PropertyDetails;

// `http://localhost:3000/images/${photo}`
